import React from 'react';
import s from "./Household.module.css";
import Category from "../Category/Category";
import Subcategories from "../Subcategories/Subcategories.js";

import archtect from './../architect.svg';
import auto from './../auto.svg';
import fridge from './../fridge.svg';
import furniture from './../furniture.svg';

import {
  TRANSPORT, IMMOVABLES,
  APPLIANCE, FURNITURE
} from "../../redux/UrlReducer";

const Household = (props) => {

  const immovables = props.catList[0];
  const transport = props.catList[1];
  const appliance = props.catList[2];
  const furniture = props.catList[3]

  return (
      <div>
        <h3>Выберите категорию</h3>
        <div className={s.content}>
          <div className={s.categories}>
            <Category nameCategory={immovables.categoryName} imgPath={archtect} urlCategory={immovables.categoryUrl}/>
            <Category nameCategory={transport.categoryName} imgPath={auto} urlCategory={transport.categoryUrl}/>
            <Subcategories nameSubCat={appliance.subcategories} imgPath={fridge} urlSubcategory={appliance.subcategoryUrl}/>
            <Subcategories nameSubCat={furniture.subcategories} imgPath={furniture} urlSubcategory={FURNITURE.subcategoryUrl}/>
          </div>
        </div>
      </div>
  );
};

export default Household;
